import React, {Component} from 'react';
import './Dashboard.css';
import axios from 'axios'

class Dashboard extends Component {
    constructor(props) {
        super(props);
        this.state = {data: []}
    }

    async componentDidMount() {
        const url = `https://covid-19-coronavirus-statistics.p.rapidapi.com/v1/total`;
        let response = await axios.get(url)
        console.log(response.data);
        this.setState({data: response.data} )
    }

  render() {
    return (
      <div className="Dashboard">
          <h1 className="Dashboard-title">COVID-19 Dashboard</h1>
          <h1 className="People-Recovered">Recovered: {this.state.data.Recovered}</h1>
          <h1 className="People-Deaths">Deaths: {this.state.data.Deaths}</h1>
          <h1 className="People-Confirmed">Confirmed: {this.state.data.Confirmed}</h1>
          <h1 className="People-lastChecked">lastChecked: {this.state.data.lastChecked}</h1>
          <h1 className="People-lastReported">lastReported: {this.state.data.lastReported}</h1>
      </div>
    );
  }
}

export default Dashboard;
